    padding: 2rem;
    max-width: 1200px;
    margin: 0 auto;
  }

  .demo-section {
    margin-bottom: 3rem;
  }

  .demo-grid {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(400px, 1fr));
    gap: 2rem;
    margin-top: 1rem;
  }

  .color-grid {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    gap: 1rem;
  }

  .color-sample {
    display: flex;
    align-items: center;
    margin-bottom: 1rem;
  }

  .color-box {
    width: 48px;
    height: 48px;
    border-radius: 8px;
