    border: none;
  }

  .card {
    padding: 1.5rem;
    border-radius: 0.5rem;
    border: 1px solid var(--card-border-color, var(--color-border));
    background-color: var(--card-bg-color, var(--color-background));
    box-shadow: var(--card-shadow);
  }

  .form-sample {
