      {/* Journey Section */}
      <div id="journey" className={showRegistration ? 'dimmed' : ''}>
        <Suspense fallback={<LoadingSkeleton height="500px" type="journey" />}>
          <Journey journey={transformedJourneyData} />
        </Suspense>
      </div>

      {/* Training Section */}
