/**
 * TrainingFeatures component variant types
 */
export type TrainingFeaturesVariant = 'default' | 'gym' | 'sports' | 'wellness' | 'modern' | 'classic' | 'minimalist';

/**
 * Maps TrainingFeatures component variants to theme options
 * 
 * @param variant - The TrainingFeatures component variant
 * @returns The appropriate ThemeOption
 */
export const mapVariantToTheme = (variant: TrainingFeaturesVariant | undefined): ThemeOption => {
  // Direct mappings for variants that match themes
  if (variant === 'default' || variant === 'gym' || variant === 'sports' || variant === 'wellness') {
    return variant;
  }

  // Map other variants to appropriate themes
  switch (variant) {
    case 'modern': return 'sports';
    case 'classic': return 'default';
    case 'minimalist': return 'default';
    default: return 'default';
  }
};

/**
 * Maps feature type to an appropriate theme
 * 
 * @param featureType - The feature type
 * @returns The appropriate ThemeOption
 */
export const mapFeatureTypeToTheme = (featureType: string | undefined): ThemeOption => {
  switch (featureType) {
    case 'virtual': return 'default'; // Green gradient theme
    case 'tracking': return 'gym'; // Purple gradient theme
    case 'scheduling': return 'sports'; // Blue gradient theme
    case 'support': return 'wellness'; // Orange gradient theme
    case 'mobile': return 'sports'; // Pink-blue gradient theme
    default: return 'default';
  }
};

/**
 * Maps gradient class name to feature type
 * 
 * @param gradientClass - CSS gradient class name
 * @returns The matching feature type
 */
export const mapGradientToFeatureType = (gradientClass: string | undefined): 'virtual' | 'tracking' | 'scheduling' | 'support' | 'mobile' => {
  if (!gradientClass) return 'virtual';

  if (gradientClass.includes('lime') || gradientClass.includes('emerald') || gradientClass.includes('green')) {
    return 'virtual';
  }

  if (gradientClass.includes('violet') || gradientClass.includes('purple')) {
    return 'tracking';
  }

  if (gradientClass.includes('cyan') || gradientClass.includes('blue')) {
    return 'scheduling';
  }

  if (gradientClass.includes('amber') || gradientClass.includes('orange')) {
    return 'support';
  }

  if (gradientClass.includes('rose') || gradientClass.includes('pink')) {
    return 'mobile';
  }

  return 'virtual'; // Default
};

import logger from "../../../../../utils/logger";
import {
    AnthropometricsData,
    InjuriesData,
    LiabilityWaiverData,
    MedicalClearanceData,
    MedicalCustomizationData
} from "../types";

// Storage key for medical customization data
const STORAGE_KEY = 'fitcopilot_medical_customization_data';

/**
 * Type for section key names
 */
type SectionKey = 'anthropometrics' | 'injuries' | 'medicalClearance' | 'liabilityWaiver';

/**
 * Updates a specific section of medical customization data
 */
export const updateCustomizationSection = (
  section: SectionKey,
  data: AnthropometricsData | InjuriesData | MedicalClearanceData | LiabilityWaiverData
): void => {
  try {
    // Get existing data
    const existingData = getMedicalCustomizationData();

    // Update the specified section
    const updatedData = {
      ...existingData,
      [section]: data
    };

    // Add this section to completedSections if it's not already there
    // This is important for restoring state properly
    if (!updatedData.completedSections) {
      updatedData.completedSections = [];
    }

    // Save to storage
    sessionStorage.setItem(STORAGE_KEY, JSON.stringify(updatedData));
  } catch (error) {
    logger.error(`Failed to update ${section} customization data:`, error);
  }
};

/**
 * Save medical customization data with basic error handling
 */
export const saveMedicalCustomizationData = async (
  data: MedicalCustomizationData
): Promise<{ success: boolean; error?: string }> => {
  try {
    const dataToStore = {
      ...data,
      timestamp: new Date().toISOString()
    };

    sessionStorage.setItem(STORAGE_KEY, JSON.stringify(dataToStore));
    return { success: true };
  } catch (error) {
    logger.error('Failed to save medical customization data:', error);
    return {
      success: false,
      error: error instanceof Error ? error.message : 'Failed to save your medical information'
    };
  }
};

/**
 * Load medical customization data with error handling
 */
export const getMedicalCustomizationData = (): MedicalCustomizationData | null => {
  try {
    const storedData = sessionStorage.getItem(STORAGE_KEY);
    if (!storedData) return null;

    const parsedData = JSON.parse(storedData);

    // Ensure completedSections exists for backward compatibility
    if (!parsedData.completedSections) {
      parsedData.completedSections = [];
    }

    return parsedData;
  } catch (error) {
    logger.error('Failed to load medical customization data:', error);
    // Return minimal valid data structure for graceful degradation
    return { completedSections: [] };
  }
};

/**
 * Clears all stored medical customization data
 */
export const clearMedicalCustomizationData = (): void => {
  try {
    sessionStorage.removeItem(STORAGE_KEY);
  } catch (error) {
    logger.error('Failed to clear medical customization data:', error);
  }
};

/**
 * Simple retry utility for operations that might fail
 */
export const withRetry = async <T>(
  operation: () => Promise<T>,
  maxRetries: number = 2
): Promise<{ success: boolean; result?: T; error?: string }> => {
  let attempts = 0;

  const attempt = async (): Promise<{ success: boolean; result?: T; error?: string }> => {
    try {
      const result = await operation();
      return { success: true, result };
    } catch (error) {
      attempts++;
      logger.error(`Operation failed (attempt ${attempts}/${maxRetries + 1}):`, error);

      if (attempts <= maxRetries) {
        // Simple linear backoff
        await new Promise(resolve => setTimeout(resolve, 300 * attempts));
        return attempt();
      }

      return {
        success: false,
        error: error instanceof Error ? error.message : 'Operation failed after multiple attempts'
      };
    }
  };

  return attempt();
};

