      return logger.addContext('JourneyContext');
    }
    // Fallback to a minimal logger if the main logger is not ready
    return {
      debug: (message: string, ...data: unknown[]) => console.log(`[JourneyContext] ${message}`, ...data),
      info: (message: string, ...data: unknown[]) => console.info(`[JourneyContext] ${message}`, ...data),
      warn: (message: string, ...data: unknown[]) => console.warn(`[JourneyContext] ${message}`, ...data),
      error: (message: string, ...data: unknown[]) => console.error(`[JourneyContext] ${message}`, ...data)
    };
  } catch (err) {
    // In case of any error, provide a minimal fallback logger
    console.warn('Failed to initialize journeyLogger, using fallback', err);
    return {
      debug: (message: string, ...data: unknown[]) => console.log(`[JourneyContext] ${message}`, ...data),
      info: (message: string, ...data: unknown[]) => console.info(`[JourneyContext] ${message}`, ...data),
      warn: (message: string, ...data: unknown[]) => console.warn(`[JourneyContext] ${message}`, ...data),
      error: (message: string, ...data: unknown[]) => console.error(`[JourneyContext] ${message}`, ...data)
    };
  }
})();

// Define the context state interface
interface JourneyContextState {
    expandedStep: number | null;
    activeSubstep: string | null;
    completedSteps: number[];
    registrationData: RegistrationData;
    isDirty: boolean;
    isSaving: boolean;
}

// Define the context interface with state and actions
interface JourneyContextValue extends JourneyContextState {
    toggleStep: (index: number) => void;
    setActiveSubstep: (substep: string | null) => void;
    markStepComplete: (stepIndex: number) => void;
    updateRegistrationData: (newData: Partial<RegistrationData>) => void;
    resetJourney: () => void;
}

// Create the context with a default undefined value
const JourneyContext = createContext<JourneyContextValue | undefined>(undefined);

// Initial state
const initialState: JourneyContextState = {
  expandedStep: null,
  activeSubstep: null,
  completedSteps: [],
  registrationData: {},
  isDirty: false,
  isSaving: false,
};

// Storage key for session storage
const STORAGE_KEY = 'fitcopilot_journey_state';

// Provider component
export const JourneyProvider: React.FC<{
    children: React.ReactNode;
    initialData?: RegistrationData;
}> = ({ children, initialData = {} }) => {
  journeyLogger.debug('JourneyProvider initializing', { hasInitialData: Object.keys(initialData).length > 0 });

  // Initialize state from session storage or props
  const [state, setState] = useState<JourneyContextState>(() => {
    // Try to load from session storage
    const storedState = sessionStorage.getItem(STORAGE_KEY);
    if (storedState) {
      try {
        const parsedState = JSON.parse(storedState);
        journeyLogger.debug('Restored journey state from session storage');
        return { ...parsedState, isSaving: false };
      } catch (error) {
        journeyLogger.error('Failed to parse stored journey state', { error });
      }
    }
    // Fall back to initial state with any provided data
    journeyLogger.debug('Using initial journey state', { dataFields: Object.keys(initialData) });
    return { ...initialState, registrationData: initialData };
  });

  // Save state to session storage whenever it changes
  useEffect(() => {
    if (state.isDirty) {
      setState(prev => ({ ...prev, isSaving: true }));

      // Debounce saving to avoid excessive writes
      const saveTimeout = setTimeout(() => {
        try {
          sessionStorage.setItem(STORAGE_KEY, JSON.stringify(state));
          setState(prev => ({ ...prev, isDirty: false, isSaving: false }));
          journeyLogger.debug('Journey state saved to session storage');
        } catch (error) {
          journeyLogger.error('Failed to save journey state', { error });
          setState(prev => ({ ...prev, isSaving: false }));
        }
      }, 300);

      return () => clearTimeout(saveTimeout);
    }
  }, [state]);

  // Toggle expanded step
  const toggleStep = useCallback((index: number) => {
    setState(prev => {
      const newExpandedStep = prev.expandedStep === index ? null : index;
      journeyLogger.debug('Toggling step', {
        previousStep: prev.expandedStep,
        newStep: newExpandedStep
      });
      return {
        ...prev,
        expandedStep: newExpandedStep,
        isDirty: true
      };
    });
  }, []);

  // Set active substep
  const setActiveSubstep = useCallback((substep: string | null) => {
    setState(prev => {
      journeyLogger.debug('Setting active substep', {
        previousSubstep: prev.activeSubstep,
        newSubstep: substep
      });
      return {
        ...prev,
        activeSubstep: substep,
        isDirty: true
      };
    });
  }, []);

  // Mark a step as complete
  const markStepComplete = useCallback((stepIndex: number) => {
    setState(prev => {
      if (prev.completedSteps.includes(stepIndex)) {
        journeyLogger.debug('Step already marked complete', { stepIndex });
        return prev;
      }
      journeyLogger.debug('Marking step complete', {
        stepIndex,
        completedSteps: [...prev.completedSteps, stepIndex]
      });
      return {
        ...prev,
        completedSteps: [...prev.completedSteps, stepIndex],
        isDirty: true
      };
    });
  }, []);

  // Update registration data
  const updateRegistrationData = useCallback((newData: Partial<RegistrationData>) => {
    setState(prev => {
      journeyLogger.debug('Updating registration data', {
        updatedFields: Object.keys(newData)
      });
      return {
        ...prev,
        registrationData: { ...prev.registrationData, ...newData },
        isDirty: true
      };
    });
  }, []);

  // Reset journey state
  const resetJourney = useCallback(() => {
    journeyLogger.info('Resetting journey state');
    setState({ ...initialState });
    sessionStorage.removeItem(STORAGE_KEY);
  }, []);

  // Context value
  const value: JourneyContextValue = {
    ...state,
    toggleStep,
    setActiveSubstep,
    markStepComplete,
    updateRegistrationData,
    resetJourney
  };

  return (
    <JourneyContext.Provider value={value}>
      {children}
    </JourneyContext.Provider>
  );
};

// Custom hook to use the context
export const useJourney = (): JourneyContextValue => {
  const context = useContext(JourneyContext);
  if (context === undefined) {
    journeyLogger.error('useJourney called outside of JourneyProvider');
    throw new Error('useJourney must be used within a JourneyProvider');
  }
  return context;
};

export default JourneyContext;

import { useCallback, useState } from 'react';
import useApi, { ApiResponse } from '../../../hooks/useApi';
import logger from '../../../utils/logger';
import { RegistrationData, RegistrationStep } from '../types';

// Create form-specific logger
const formLogger = logger.addContext('RegistrationForm');

/**
 * Registration submission response type
 */
interface RegistrationResponse {
    user_id: number;
    status: string;
    message?: string;
    redirect_url?: string;
}

/**
 * Email validation response type
 */
interface EmailValidationResponse {
    isValid: boolean;
    message?: string;
}

/**
 * Form validation state type
 */
interface FormValidationState {
    isValid: boolean;
    errors: Record<string, string>;
}

/**
 * Extended RegistrationStep enum with additional steps
 */
enum ExtendedRegistrationStep {
    GOALS = RegistrationStep.GOALS,
    EXPERIENCE_LEVEL = RegistrationStep.EXPERIENCE_LEVEL,
    CUSTOMIZE_EXPERIENCE = 'customize_experience',
    ACCOUNT_CREATION = 'account_creation'
}

/**
 * Hook for registration form management with proper type safety
 * 
 * @param initialData Initial registration data (if any)
 * @returns Registration form utilities and state
 */
const useRegistrationForm = (initialData?: Partial<RegistrationData>) => {
  // Form data state
  const [formData, setFormData] = useState<Partial<RegistrationData>>(initialData || {});

  // Form validation state
  const [validation, setValidation] = useState<FormValidationState>({
    isValid: true,
    errors: {}
  });

  // Step state
  const [currentStep, setCurrentStep] = useState<ExtendedRegistrationStep>(ExtendedRegistrationStep.GOALS);

  // Use our API hooks with proper typing
  const registrationApi = useApi<RegistrationResponse>();
  const emailValidationApi = useApi<EmailValidationResponse>();

  /**
     * Update form data with new values
     */
  const updateFormData = useCallback((newData: Partial<RegistrationData>) => {
    formLogger.debug('Updating form data', {
      fields: Object.keys(newData),
      currentStep
    });

    setFormData(prevData => ({
      ...prevData,
      ...newData
    }));

    // Clear any errors for the updated fields
    if (validation.errors && Object.keys(validation.errors).length > 0) {
      const updatedFields = Object.keys(newData);
      const remainingErrors = { ...validation.errors };

      let errorsRemoved = false;
      updatedFields.forEach(field => {
        if (remainingErrors[field]) {
          delete remainingErrors[field];
          errorsRemoved = true;
        }
      });

      if (errorsRemoved) {
        setValidation({
          isValid: Object.keys(remainingErrors).length === 0,
          errors: remainingErrors
        });
      }
    }
  }, [currentStep, validation.errors]);

  /**
     * Validate an email address
     */
  const validateEmail = useCallback(async (email: string): Promise<boolean> => {
    try {
      const response = await emailValidationApi.fetchApi('/fitcopilot/v1/validate-email', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json'
        }
      });

      return (response as ApiResponse<EmailValidationResponse>).data.isValid;
    } catch (error) {
      formLogger.error('Email validation failed', { error });
      setValidation(prev => ({
        ...prev,
        isValid: false,
        errors: {
          ...prev.errors,
          email: 'Failed to validate email. Please try again.'
        }
      }));
      return false;
    }
  }, [emailValidationApi]);

  /**
     * Validate form data for the current step
     */
  const validateCurrentStep = useCallback((): boolean => {
    let isValid = true;
    const errors: Record<string, string> = {};

    switch (currentStep) {
    case ExtendedRegistrationStep.GOALS:
      if (!formData.goals || formData.goals.length === 0) {
        errors.goals = 'Please select at least one goal';
        isValid = false;
      }
      break;

    case ExtendedRegistrationStep.EXPERIENCE_LEVEL:
      if (!formData.experienceLevel) {
        errors.experienceLevel = 'Please select your experience level';
        isValid = false;
      }
      break;

    case ExtendedRegistrationStep.CUSTOMIZE_EXPERIENCE:
      if (!formData.equipment || formData.equipment.length === 0) {
        errors.equipment = 'Please select available equipment';
        isValid = false;
      }
      if (!formData.timeCommitment) {
        errors.timeCommitment = 'Please select your time commitment';
        isValid = false;
      }
      break;

    case ExtendedRegistrationStep.ACCOUNT_CREATION:
      if (!formData.email) {
        errors.email = 'Email is required';
        isValid = false;
      } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
        errors.email = 'Please enter a valid email address';
        isValid = false;
      }
      if (!formData.password) {
        errors.password = 'Password is required';
        isValid = false;
      } else if (formData.password.length < 8) {
        errors.password = 'Password must be at least 8 characters';
        isValid = false;
      }
      break;

    default:
      break;
    }

    setValidation({ isValid, errors });
    return isValid;
  }, [currentStep, formData]);

  /**
     * Move to the next step in the registration flow
     */
  const goToNextStep = useCallback(() => {
    if (validateCurrentStep()) {
      formLogger.debug('Moving to next step', {
        currentStep,
        nextStep: currentStep + 1
      });

      // Get next step value based on current step - safe conversion needed
      // This is simplified logic - you may need a more robust step transition map
      let nextStep: ExtendedRegistrationStep;

      if (currentStep === ExtendedRegistrationStep.GOALS) {
        nextStep = ExtendedRegistrationStep.EXPERIENCE_LEVEL;
      } else if (currentStep === ExtendedRegistrationStep.EXPERIENCE_LEVEL) {
        nextStep = ExtendedRegistrationStep.CUSTOMIZE_EXPERIENCE;
      } else if (currentStep === ExtendedRegistrationStep.CUSTOMIZE_EXPERIENCE) {
        nextStep = ExtendedRegistrationStep.ACCOUNT_CREATION;
      } else {
        // Default fallback or final step
        nextStep = currentStep;
      }

      setCurrentStep(nextStep);
    }
  }, [currentStep, validateCurrentStep]);

  /**
     * Move to the previous step in the registration flow
     */
  const goToPreviousStep = useCallback(() => {
    formLogger.debug('Moving to previous step', {
      currentStep,
      prevStep: 'previous step'
    });

    // Similar logic to goToNextStep but in reverse
    let prevStep: ExtendedRegistrationStep;

    if (currentStep === ExtendedRegistrationStep.ACCOUNT_CREATION) {
      prevStep = ExtendedRegistrationStep.CUSTOMIZE_EXPERIENCE;
    } else if (currentStep === ExtendedRegistrationStep.CUSTOMIZE_EXPERIENCE) {
      prevStep = ExtendedRegistrationStep.EXPERIENCE_LEVEL;
    } else if (currentStep === ExtendedRegistrationStep.EXPERIENCE_LEVEL) {
      prevStep = ExtendedRegistrationStep.GOALS;
    } else {
      // Default fallback
      prevStep = currentStep;
    }

    setCurrentStep(prevStep);
  }, [currentStep]);

  /**
     * Submit the registration form data
     */
  const submitForm = useCallback(async (): Promise<ApiResponse<RegistrationResponse> | null> => {
    if (!validateCurrentStep()) {
      return null;
    }

    try {
      formLogger.debug('Submitting registration form', {
        dataFields: Object.keys(formData)
      });

      const response = await registrationApi.fetchApi('/fitcopilot/v1/registration', {
        method: 'POST',
        body: JSON.stringify(formData as RegistrationData)
      });

      const typedResponse = response as ApiResponse<RegistrationResponse>;

      formLogger.info('Registration submitted successfully', {
        userId: typedResponse.data.user_id,
        status: typedResponse.data.status
      });

      return typedResponse;
    } catch (error) {
      formLogger.error('Registration submission failed', { error });
      setValidation(prev => ({
        ...prev,
        isValid: false,
        errors: {
          ...prev.errors,
          form: 'Failed to submit registration. Please try again.'
        }
      }));
      return null;
    }
  }, [formData, registrationApi, validateCurrentStep]);

  return {
    formData,
    updateFormData,
    validation,
    validateEmail,
    validateCurrentStep,
    currentStep,
    goToNextStep,
    goToPreviousStep,
    submitForm,
    isSubmitting: registrationApi.loading,
    submitError: registrationApi.error
  };
};

export default useRegistrationForm;

