    .map(([key, value]) => `${key}: ${value};`)
    .join('\n');

  // Apply CSS to the mock stylesheet
  style.innerHTML = `
    :root {
      ${cssText}
    }

    [data-theme="${theme}"] {
      ${cssText}
    }
  `;

  // Return a cleanup function
  return () => {
    document.head.removeChild(style);
  };
};

